import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { getStoreGames } from '../services/apiService';
import './StorePage.css';

export default function StorePage() {
  const navigate = useNavigate();
  const [allGames, setAllGames] = useState([]);
  const [searchTerm, setSearchTerm] = useState('');

  // Pagination state
  const ITEMS_PER_PAGE = 4;
  const [specialPage, setSpecialPage] = useState(1);
  const [freePage, setFreePage] = useState(1);
  const [bestPage, setBestPage] = useState(1);

  useEffect(() => {
    async function fetchGames() {
      try {
        const games = await getStoreGames();
        setAllGames(games);
      } catch (err) {
        console.error('Failed loading store games:', err);
      }
    }
    fetchGames();
  }, []);

  // Filtered sections
  const featured = allGames.slice(0, 1);
  const specials = allGames.filter(g => g.discount > 0);
  const frees = allGames.filter(g => g.price === 0);
  const bests = allGames.filter(g => g.price > 0);

  // Pagination helpers
  const paginate = (items, page) => {
    const start = (page - 1) * ITEMS_PER_PAGE;
    return items.slice(start, start + ITEMS_PER_PAGE);
  };
  const totalPages = items => Math.ceil(items.length / ITEMS_PER_PAGE);

  const specialOffers = paginate(specials, specialPage);
  const freeGames = paginate(frees, freePage);
  const bestSellers = paginate(bests, bestPage);

  // Search suggestions
  const suggestions = searchTerm
    ? allGames.filter(g => g.title.toLowerCase().includes(searchTerm.toLowerCase())).slice(0, 5)
    : [];

  return (
    <div className="store-page">
      <header className="store-header">
        <div className="content-container nav">
          <span onClick={() => navigate('/')}>STEAM</span>
          <nav>
            <a onClick={() => navigate('/')}>Home</a>
            <a onClick={() => navigate('/extras')}>Extras</a>
          </nav>
        </div>
      </header>

      <div className="search-bar content-container">
        <input
          placeholder="Tìm kiếm trò chơi..."
          value={searchTerm}
          onChange={e => setSearchTerm(e.target.value)}
        />
        {suggestions.length > 0 && (
          <ul className="suggestions-list">
            {suggestions.map(g => (
              <li key={g.id} onClick={() => navigate(`/game/${g.key}`)}>
                {g.title}
              </li>
            ))}
          </ul>
        )}
      </div>

      <section className="featured-container">
        <h2>Featured</h2>
        <div className="featured">
          {featured.map(g => (
            <div key={g.id} className="featured-item" onClick={() => navigate(`/game/${g.key}`)}>
              <img src={g.imageUrl} alt={g.title} />
              <div className="game-info">
                <h3>{g.title}</h3>
                <p>{g.description}</p>
              </div>
            </div>
          ))}
        </div>
      </section>

      {/* Special Offers with pagination */}
      <section className="special-offers content-container">
        <h2>Special Offers</h2>
        <div className="game-list">
          {specialOffers.map(g => (
            <div key={g.id} className="game-card" onClick={() => navigate(`/game/${g.key}`)}>
              <div className="discount">-{g.discount}%</div>
              <img src={g.imageUrl} alt={g.title} />
              <h3>{g.title}</h3>
              <div className="price">${g.price.toFixed(2)}</div>
            </div>
          ))}
        </div>
        {totalPages(specials) > 1 && (
          <div className="pagination">
            <button disabled={specialPage === 1} onClick={() => setSpecialPage(specialPage - 1)}>&lt; Prev</button>
            <span>{specialPage} / {totalPages(specials)}</span>
            <button disabled={specialPage === totalPages(specials)} onClick={() => setSpecialPage(specialPage + 1)}>Next &gt;</button>
          </div>
        )}
      </section>

      {/* Free Games with pagination */}
      <section className="free-games content-container">
        <h2>Free-to-play Games</h2>
        <div className="game-list">
          {freeGames.map(g => (
            <div key={g.id} className="game-card" onClick={() => navigate(`/game/${g.key}`)}>
              <img src={g.imageUrl} alt={g.title} />
              <h3>{g.title}</h3>
              <div className="price">Free</div>
            </div>
          ))}
        </div>
        {totalPages(frees) > 1 && (
          <div className="pagination">
            <button disabled={freePage === 1} onClick={() => setFreePage(freePage - 1)}>&lt; Prev</button>
            <span>{freePage} / {totalPages(frees)}</span>
            <button disabled={freePage === totalPages(frees)} onClick={() => setFreePage(freePage + 1)}>Next &gt;</button>
          </div>
        )}
      </section>

      {/* Best Sellers with pagination */}
      <section className="best-seller content-container">
        <h2>Best Sellers</h2>
        <div className="game-list">
          {bestSellers.map(g => (
            <div key={g.id} className="game-card" onClick={() => navigate(`/game/${g.key}`)}>
              <img src={g.imageUrl} alt={g.title} />
              <h3>{g.title}</h3>
              <div className="price">${g.price.toFixed(2)}</div>
            </div>
          ))}
        </div>
        {totalPages(bests) > 1 && (
          <div className="pagination">
            <button disabled={bestPage === 1} onClick={() => setBestPage(bestPage - 1)}>&lt; Prev</button>
            <span>{bestPage} / {totalPages(bests)}</span>
            <button disabled={bestPage === totalPages(bests)} onClick={() => setBestPage(bestPage + 1)}>Next &gt;</button>
          </div>
        )}
      </section>

      <footer className="footer content-container">
        <div className="footer-content">
          <ul><li>About</li><li>Support</li></ul>
          <ul><li>Privacy Policy</li><li>Legal</li><li>Cookies</li></ul>
        </div>
      </footer>
    </div>
  );
}
